import math

def extract_last_n_primes(lst, n):

    def is_prime(num):
        if num <= 2:
            return False
        for i in range(2, int(math.sqrt(num)) + 1):
            if num % i == 0:
                return False
        return True
    primes = set()
    for num in reversed(lst):
        if is_prime(num):
            primes.add(num)
        if len(primes) == n:
            break
    return list(reversed(list(primes)))

